#include <stdio.h>
#include <string.h>

typedef struct
{
	int x;
	int y;
	int dir;
}Robot;

int main(void)
{
	int k, i, j, x, y;
	char dir;
	int rob, step;
	int a, b, n, m, dig;
	int cb[102][102];
	Robot rb[101] = {0};

	scanf("%d", &k);
	while (k--)
	{
		scanf("%d%d", &a, &b);
		scanf("%d%d", &n, &m);

		memset(cb, 0, sizeof(cb));
		for (i = 1 ; i <= n ; i++)
		{
			scanf("%d%d%*c%c", &rb[i].x, &rb[i].y, &dir);
			switch (dir)
			{
				case 'E':
					rb[i].dir = 0;
					break;
				case 'S':
					rb[i].dir = 1;
					break;
				case 'W':
					rb[i].dir = 2;
					break;
				case 'N':
					rb[i].dir = 3;
					break;
			}
			cb[rb[i].y][rb[i].x] = i;
		}

		dig = 1;
		for (i = 0 ; i < m ; i++)
		{
			scanf("%d%*c%c%d", &rob, &dir, &step);
			if (dig)
			{
				switch (dir)
				{
					case 'R':
						rb[rob].dir = (rb[rob].dir + step) % 4;
						continue;
					case 'L':
						rb[rob].dir = (rb[rob].dir + 4 - (step % 4)) % 4;
						continue;
				}
				x = rb[rob].x;
				y = rb[rob].y;
				switch (rb[rob].dir)
				{
					case 0:
						x += step;
						for (j = rb[rob].x + 1; j <= a && j <= x ; j++)
						{
							if (cb[y][j])
							{
								dig = 0;
								printf("Robot %d crashes into robot %d\n", rob, cb[y][j]);
								break;
							}
						}
						if (dig && x > a)
						{
							dig = 0;
							printf("Robot %d crashes into the wall\n", rob);
						}
						if (dig)
						{
							cb[rb[rob].y][rb[rob].x] = 0;
							rb[rob].x = x;
							cb[rb[rob].y][rb[rob].x] = rob;
						}
						break;
					case 1:
						y -= step;
						for (j = rb[rob].y - 1; j && j >= y ; j--)
						{
							if (cb[j][x])
							{
								dig = 0;
								printf("Robot %d crashes into robot %d\n", rob, cb[j][x]);
								break;
							}
						}
						if (dig && y < 1)
						{
							dig = 0;
							printf("Robot %d crashes into the wall\n", rob);
						}
						if (dig)
						{
							cb[rb[rob].y][rb[rob].x] = 0;
							rb[rob].y = y;
							cb[rb[rob].y][rb[rob].x] = rob;
						}
						break;
					case 2:
						x -= step;
						for (j = rb[rob].x - 1; j && j >= x ; j--)
						{
							if (cb[y][j])
							{
								dig = 0;
								printf("Robot %d crashes into robot %d\n", rob, cb[y][j]);
								break;
							}
						}
						if (dig && x < 1)
						{
							dig = 0;
							printf("Robot %d crashes into the wall\n", rob);
						}
						if (dig)
						{
							cb[rb[rob].y][rb[rob].x] = 0;
							rb[rob].x = x;
							cb[rb[rob].y][rb[rob].x] = rob;
						}
						break;
					case 3:
						y += step;
						for (j = rb[rob].y + 1; j <= b && j <= y ; j++)
						{
							if (cb[j][x])
							{
								dig = 0;
								printf("Robot %d crashes into robot %d\n", rob, cb[j][x]);
								break;
							}
						}
						if (dig && y > b)
						{
							dig = 0;
							printf("Robot %d crashes into the wall\n", rob);
						}
						if (dig)
						{
							cb[rb[rob].y][rb[rob].x] = 0;
							rb[rob].y = y;
							cb[rb[rob].y][rb[rob].x] = rob;
						}
						break;
				}
			}
		}
		if (dig) puts("OK");
	}

	return 0;
}

