	int n,count,i;
	scanf("%d",&t);
	while(t--)
	{
		count=0;
		scanf("%d",&n);
		for(i=0;i<n;i++)
		{
			scanf("%d",a+i);
			count+=a[i];
		}
		count=count-n+1;
		printf("%d\n",count);
	}
	return 0;
}

#include <stdio.h>

int main(void)
{
	int t;
	int i, j;
	int s, h;
	int d[50][2];
	int k, dig;
	double max, r, min;
	double l;

	scanf("%d", &t);
	while (t--)
	{
		scanf("%d%d", &s, &h);
		for (i = 0 ; i < h ; i++)
			scanf("%d%d", d[i], d[i] + 1);
		dig = 0;
		for (i = 1 ; i < s ; i++)
		{
			for (j = 1 ; j < s ; j++)
			{
				r = i < s - i ? i : s - i;
				if (r > j) r = j;
				if (r > s - j) r = s - j;
				r *= r;
				max = 0;
				min = 10000000;
				for (k = 0 ; k < h ; k++)
				{
					l = (d[k][0] - i) * (d[k][0] - i) + (d[k][1] - j) * (d[k][1] - j);
					if (l > max) max = l;
					if (l < min) min = l;
				}
				if (r >= max && min > 1E-6)
				{
					dig = 1;
					break;
				}
			}
			if (dig) break;
		}
		if (dig)
		{
			printf("%d %d\n", i, j);
		}
		else
			puts("poodle");
	}

	return 0;
}

#include "iostream"

using namespace std;

int ttime[501][2];
int weight[501][5];
int map[501][501];
int ssearch[501];
int prev[501],m;


int dfs(int data)
{   
	int i;
	int temp;
	for(i=0;i<m;i++)
	{
                if( map[data][i] && ssearch[i] != 1 )//增广路
                {   
			ssearch[i]=1;
			temp=prev[i];
			prev[i]=data;

			if(temp==-1||dfs(temp))
				return 1;

			prev[i]=temp;
                }
	}
	return false;
}

int main ()
{
	int i,j;
	int n;
	int a,b,c,d;
	int temp1,temp2;
	int num;

	//freopen("in.txt","r",stdin);

	scanf("%d",&n);
	for(;n--;)
	{
		scanf("%d",&m);
		for(i=0 ; i<m; i++)
		{
			scanf("%d:%d %d%d%d%d",&ttime[i][0],&ttime[i][1],&a,&b,&c,&d);
			weight[i][0] = a;
			weight[i][1] = b;
			weight[i][2] = c;
			weight[i][3] = d;
			weight[i][4] =  abs(a-c)+abs(b-d);
		}
		memset(map,0,sizeof(map));

		for(i=0;i<m;i++)
		{
			

			for( j=0 ; j<m ; j++)
			{
				if( i==j )
					continue;
				temp1 = ttime[i][0] + ( ttime[i][1] + weight[i][4] + abs(weight[i][2] -weight[j][0]) +abs(weight[i][3] - weight[j][1]) )/60 ;
				temp2 = ( ttime[i][1] + weight[i][4] + abs(weight[i][2] -weight[j][0]) +abs(weight[i][3] - weight[j][1]) )%60;
				if( temp1 < ttime[j][0] )
				{
					map[i][j] = 1;
				}
				else
					if(temp1 == ttime[j][0] && temp2 <= ttime[j][1] - 1 )
					{
						map[i][j] = 1;
					}
			}
		}

		memset( prev,-1,sizeof(prev) );

		for(i=0 ; i<m ; i++)
		{
			memset(ssearch,0,sizeof(ssearch));
			dfs(i);
		}

		num=0;

		for(i=0;i<m;i++)
		{
			if(prev[i]!=-1)
				num++;
		}
		printf("%d\n", m - num);

	}

	return 1;
}

