#include <ctype.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

typedef struct
{
	int ord;
	int sut;
}Card;

int cmp(const Card *a, const Card *b)
{
	if ((*a).ord != (*b).ord)
		return (*b).ord - (*a).ord;
	else
		return (*b).sut - (*a).sut;
}

int main(void)
{
	int t, n, i, j;
	char s, o;
	Card A[26];
	Card B[26];

	scanf("%d", &t);
	while (t--)
	{
		//init
		scanf("%d%*c", &n);
		for (i = 0 ; i < n ; i++)
		{
			scanf("%c%c%*c", &o, &s);
			switch (o)
			{
				case 'A':
					A[i].ord = 14;
					break;
				case 'T':
					A[i].ord = 10;
					break;
				case 'J':
					A[i].ord = 11;
					break;
				case 'Q':
					A[i].ord = 12;
					break;
				case 'K':
					A[i].ord = 13;
					break;
				default :
					A[i].ord = o - '0';
					break;
			}
			switch (s)
			{
				case 'C':
					A[i].sut = 0;
					break;
				case 'D':
					A[i].sut = 1;
					break;
				case 'S':
					A[i].sut = 2;
					break;
				case 'H':
					A[i].sut = 3;
					break;
			}
		}
		for (i = 0 ; i < n ; i++)
		{
			scanf("%c%c%*c", &o, &s);
			switch (o)
			{
				case 'A':
					B[i].ord = 14;
					break;
				case 'T':
					B[i].ord = 10;
					break;
				case 'J':
					B[i].ord = 11;
					break;
				case 'Q':
					B[i].ord = 12;
					break;
				case 'K':
					B[i].ord = 13;
					break;
				default :
					B[i].ord = o - '0';
					break;
			}
			switch (s)
			{
				case 'C':
					B[i].sut = 0;
					break;
				case 'D':
					B[i].sut = 1;
					break;
				case 'S':
					B[i].sut = 2;
					break;
				case 'H':
					B[i].sut = 3;
					break;
			}
		}
		qsort(A, n, sizeof(Card), cmp);
		qsort(B, n, sizeof(Card), cmp);
		//End init

		for (i = 0, j = 0 ; i < n && j < n ;)
		{
			while (j < n && cmp(&A[j], &B[i]) <= 0)
				j++;
			if (j != n) i++, j++;
		}
		printf("%d\n", i);
	}

	return 0;
}

#include   <stdio.h>   
  #include   <string.h>   
    
  int   saifa[80005];   
    
  void   add(int   a,int   b)   
  {   
  int   i;   
    
  for(i=0;i<=80000;i++)   
  {   
  if(i+a>80000)   
  {   
  break;   
  }   
  if(saifa[i]+b   >   saifa[i+a])   
  {   
  saifa[i+a]=saifa[i]+b;   
  }   
  }   
  }   
    
  int   main(void)   
  {   
  int   n,d,money,year,pay,bond;   
  int   ii,i;   
    
  scanf("%d",&n);   
  for(ii=0;ii<n;ii++)   
  {   
  memset(saifa,0,sizeof(saifa));   
  scanf("%d%d",&money,&year);   
  scanf("%d",&d);   
    
  for(i=0;i<d;i++)   
  {   
  scanf("%d%d",&pay,&bond);   
  add(pay/1000,bond);   
  }   
  for(i=0;i<year;i++)   
  {   
  money+=saifa[money/1000];   
  }   
  printf("%d\n",money);   
  }   
  return   0;   
  }

